import React from "react";
import "./StartModal.css"


const StartModal = (props) => {

    const ClickHandlingFunction = () => {
        props.onClick(true)
    }

    return (
        <div>
        <div className="backdrop" onClick={ClickHandlingFunction}/>
    <div className="modal">
        <header className="header">
            <div></div>
            <h2>{props.title}</h2>
        </header>
        <div className="content">
            <p>{props.message}</p>
        </div>
        <footer className="actions">
            <button onClick={ClickHandlingFunction}>Okay</button>
        </footer>
    </div>
    </div>
    )
}

export default StartModal;
